            var html_33ea7f12f41d42fc81f2cad9ba961417 = $(`<div id="html_33ea7f12f41d42fc81f2cad9ba961417" style="width: 100.0%; height: 100.0%;"><b><a href="https://www.greatgreenwall.org/about-great-green-wall"target=_blank> Great Green Wall</a></b><p>The Great Green Wall is a pan-Arctic initiative to combat land degradation and desertification across the Sahel                     and was formerly adopted by the African Union in 2007. It aims to restore 100m hectares of land, store                     250m tonnes of carbon in vegetation and soil, and create 10m green jobs. So far, it has restored reached 18%                     of its land restoration target through measures including improved agroforestry, water management, and                     community planting projects. <p>The 11 countries that the Great Green Wall zone passes through are Burkina Faso, Chad,                     Dijbouti, Eritrea, Ethiopia, Mali, Mauritania, Niger, Nigeria, Senegal and Sudan.</div>`)[0];
